      | 30082 -> { ItemTypeData.id= 30082; name= "OLD Legion Propulsion - Interdiction Nullifier"; published= false; description= "This subsystem is obsolete and has been replaced by newer technology    Dubbed the “interdiction nullifier” by the Guristas, who suffered its first introduction on the battlefield, this subsystem grants a startling and unprecedented capability; an immunity to non-targeted interdiction such as mobile warp disruptors and interdiction spheres.     The origins of the first “nullifier” designs are shrouded in mystery, but the subsystem's initial production of is thought to have taken place soon after the wormhole openings, and well before the technology became widespread knowledge. Not long after the first Tengu were designed, the Caldari Navy intercepted emergency transmissions from Guristas fleets across Venal, Tenal and Vale of the Silent. All of the reports made mention of Loki-class vessels slipping past defensive deployments and into core Guristas territory despite all efforts to stop the ships or slow them down.      Following these reports, rumors spread that other groups began to discover and implement this extraordinary new technology, and yet of all the factions that leapt upon the opportunity, none were so eager or ruthless in their own race to capitalize as the independent capsuleer and pirate organizations that make the nullsec frontiers their home.      Subsystem Skill Bonus:  5% increased agility per level    Role Bonus:  Immunity to non-targeted interdiction"; marketGroupId= None; groupId= 955; dogmaAttributes= [| { DogmaAttributeValueData.attributeId = 1376; value= 0.000000 }; { DogmaAttributeValueData.attributeId = 161; value= 40.000000 }; { DogmaAttributeValueData.attributeId = 162; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 1435; value= -5.000000 }; { DogmaAttributeValueData.attributeId = 4; value= 1400000.000000 }; { DogmaAttributeValueData.attributeId = 37; value= 165.000000 }; { DogmaAttributeValueData.