      | 30373 -> { ItemTypeData.id= 30373; name= "Fullerite-C72"; published= true; description= "Fullerite is the solid-state manifestation of fullerene molecules and can be found naturally occurring within interstellar gas clouds. Fullerites are coveted for the unique structural properties that make them some of the most useful materials known to humankind. Fullerene-based technology has applications in electronics, propulsion and engineering as well as the construction of ultra-hard metal alloys and heat-resistant weapons systems.     Although all of the empires have developed a rudimentary understanding of how to manipulate fullerene, only the Jovians are known to have mastered the science. This has allowed them to maintain a significant technological advantage over other races in many crucial areas. "; marketGroupId= Some(1859); groupId= 711; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= Some(3223); mass= 0.000000; packagedVolume= 2.000000; portionSize= 1; radius= 100.000000; volume= 2.000000 } |> Some
      | 30470 -> { ItemTypeData.id= 30470; name= "Neurovisual Output Analyzer"; published= true; description= "As a capsuleer, few things are more important in space-flight than the ability to instantly gauge one's surroundings and make decisions accordingly. For this reason, capsules inside starships make frequent use of neurovisual reproductions; emulations that recreate external stimuli using the most low-latency processor available: the human brain. This process relies on digital relays from camera drones and monitoring systems embedded into the hull. After the data is captured, it is then relayed directly into the brain, at which point the external surrounds are recreated almost instantaneously.    The synthetic translation of external stimuli into neurovisual imagery is incredibly risky, even relative to the standard hazards of pod piloting. Even though capsuleers have an innate resistance to neurobiological damage from these sorts of processes, the near- constant exposure to them has been linked to increased risk of aggressive neurodegenerative diseases. In recent years, engineers have begun to integrate neurovisual output analyzers into a starship's electronics systems. These devices monitor the pilot's status and, if necessary, take measures to protect against anything from mild headaches to catastrophic neural failure."; marketGroupId= Some(1147); groupId= 964; dogmaAttributes= [| { DogmaAttributeValueData.attributeId = 161; value= 5.000000 }; { DogmaAttributeValueData.attributeId = 162; value= 0.000000 }; { DogmaAttributeValueData.attributeId = 4; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 726; value= 100.000000 }; { DogmaAttributeValueData.attributeId = 38; value= 0.000000 } |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 1.000000; packagedVolume= 5.000000; portionSize= 1; radius= 1.000000; volume= 5.000000 } |> Some
